//Actions
const GET_TODOS = "components/Todo/GET_TODOS";

//Reducer
export default function todoReducer(state = [], action) {
  switch (action.type) {
    case "GET_TODOS":
      console.log(action);
      return action.todos;
    default:
      return state;
  }
}

//Action Creators
export function getTodos(todos) {
  return { type: GET_TODOS, todos };
}

//Side effects as applicable
